import { Routes, Route } from "react-router-dom";
import Login from "./pages/Auth/Login.jsx";
import DashboardAdmin from "./pages/Dashboard/DashboardAdmin.jsx";
import DashboardIdoso from "./pages/Dashboard/DashboardIdoso.jsx";
import DashboardFamiliar from "./pages/Dashboard/DashboardFamiliar.jsx";

function App() {
    return (
        <Routes>
            <Route path="/" element={<Login />} />
            <Route path="/admin" element={<DashboardAdmin />} />
            <Route path="/idoso" element={<DashboardIdoso />} />
            <Route path="/familiar" element={<DashboardFamiliar />} />
        </Routes>
    );
}

export default App;
